import 'package:flutter/material.dart';
import 'package:flutter_riverpod/flutter_riverpod.dart';


import '../models/meal_model.dart';
import '../provider/providers.dart';

class SaveData extends ConsumerStatefulWidget {
  const SaveData({super.key});

  @override
  ConsumerState<SaveData> createState() => _SaveDataState();
}

class _SaveDataState extends ConsumerState<SaveData> {
  List<Map<dynamic,dynamic>> meals = [
    {
      "id": "",
      "title": "O‘zbek palovi",
      "imageUrl": "data:image/jpeg;base64,",
      "duration": 90,
      "ingredients": "Go'sht, guruch, sabzi, piyoz, zira, tuz, yog'",
      "steps": "1. Go'shtni qovuring. 2. Sabzi va piyoz qo‘shing. 3. Guruchni soling. 4. Suv qo‘shib, dimlang.",
      "category": ["national_dishes", "greens_and_vegetable_dishes"],
      "isVegetarian": false,
      "isDiabetes": false,
      "isCalorie": true,
      "isKids": true,
      "isProtein": true,
    },

  ];


  Future<void> _addNewMeal() async {
    final storage = ref.read(authProvider.notifier);
    final meal = Meal(
      id:  DateTime.now().millisecondsSinceEpoch.toString(),
      title: meals[0]['title'],
      imageUrl: meals[0]['imageUrl'],
      duration: meals[0]['duration'],
      ingredients: meals[0]['ingredients'],
      steps: meals[0]['steps'],
      category: meals[0]['category'],
      isVegetarian: meals[0]['isVegetarian'],
      isDiabetes: meals[0]['isDiabetes'],
      isCalorie: meals[0]['isCalorie'],
      isKids: meals[0]['isKids'],
      isProtein: meals[0]['isProtein'],
    );
    await storage.addMeal(meal);
  }
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: Center(
        child: MaterialButton(
          onPressed: ()async{
            await _addNewMeal();
          },
          child: Text('Save data mi?'),
        ),
      ),
    );
  }
}
